import React,{ useState,useEffect} from 'react'
import './Flight.css'
import Axios from "axios";

const Flight = () => {

 const[allflights,setAllflights]=useState([])

  useEffect(() =>{
    Axios.get("http://localhost:3001/searchByAirport/:Airport").then((Response)=> {
      setAllflights(Response.data)
    })
  
  },[]);

  return (<div>
    <h1> Flights</h1>
   {allflights.map((val,key)=>{
     return (<div> 
       <h1>{val.Flight_Number }</h1> 
       <h1>{val.Departure_Date} </h1> 
       <h1>{val.Departure_Time }</h1>
       <h1>{val.Departure_Airport} </h1>  
       </div>)
   })}

  </div>
  )
}

export default Flight
